glsl3.vert:
precision highp float;
in vec3 a_position;
void main () {
  gl_Position = vec4(a_position, 1);
}

glsl3.frag:
precision highp float;
void main () {
  gl_FragColor = vec4(1.0);
}

glsl1.vert:
precision highp float;
attribute vec3 a_position;
void main () {
  gl_Position = vec4(a_position, 1);
}

glsl1.frag:
precision highp float;
void main () {
  gl_FragColor = vec4(1.0);
}
